import './App.css';
import { useEffect, useState } from 'react';

function App() {

  const [numero, setNumero] = useState(0);

  useEffect(() => {
    console.log(numero);
  }, [numero]);

  const handleSubmit = (e) => {
    e.preventDefault();
  }


  var divisores = (numero) => {
    var divisores = [];
    for (var i = 1; i <= numero; i++) {
      if (numero % i === 0) {
        divisores.push(i)

      }
    }
    return divisores.join(" - ");
  }


  return (
    <div className="App">
      <h1>Divisores</h1>
      <form onSubmit={handleSubmit}>
        <input text="hola" type="number" id="numero" />
        <button type="submit" onClick={() => setNumero(document.getElementById("numero").value)}>Calcular</button>
      </form>
      <h1>{divisores(numero)}</h1>
    </div>
  );
}

export default App;
